Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import java.time.Instant
import java.time.temporal.ChronoUnit

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .getOrCreate()

    // Load the onsite attributed data
    val onsiteData: JavaRDD[(String, Long)] = spark.read
      .textFile("onsite_data.txt")
      .map(line => line.split("\\s+"))
      .map(arr => (arr(0), arr(1).toLong))
      .toJavaRDD()

    // Load the top frequent queries
    val topQueries: Array[String] = spark.read
      .textFile("top_queries.txt")
      .collect()

    // Broadcast the top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries)

    // Calculate the hit rate
    val hitRate = onsiteData.mapPartitions(iter => {
      val cache = mutable.Map[String, (Long, Long)]()
      val topQueries = broadcastTopQueries.value
      iter.map { case (query, timestamp) =>
        if (topQueries.contains(query)) {
          val (lastAccess, expiry) = cache.getOrElseUpdate(query, (timestamp, timestamp + 12 * 60 * 60 * 1000))
          if (timestamp < expiry) {
            (query, true)
          } else {
            cache.update(query, (timestamp, timestamp + 12 * 60 * 60 * 1000))
            (query, false)
          }
        } else {
          (query, false)
        }
      }
    }).reduce((a, b) => (a._1 + b._1, a._2 + b._2))

    val totalQueries = hitRate._1
    val cacheHits = hitRate._2
    val hitRate = cacheHits.toDouble / totalQueries

    println(s"Hit rate: $hitRate")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and the top frequent queries. It then broadcasts the top frequent queries to all nodes in the cluster.

The job then calculates the hit rate by iterating over the onsite attributed data and checking if each query is in the top frequent queries. If it is, the job checks if the query is in the cache and if it has expired. If the query is in the cache and has not expired, it is a cache hit. If the query is not in the cache or has expired, it is a cache miss.

The job then calculates the hit rate by dividing the number of cache hits by the total number of queries.

